script: |
  super -f text -I q666.spq | sort > q666.out

inputs:
  - name: q666.spq
    data: |
      SELECT ALL - + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 + col2 * ( + + ( + CAST ( NULL AS INTEGER ) ) ) + 93 BETWEEN NULL AND - col0;
  - name: tab1

outputs:
  - name: q666.out
    data: |
